class Solution(object):
    def findSubstring(self, s, words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """
        regrex = []
        regrex_list = []
        length = 0
        num = len(words)

        if len(list(set(words))) == 1:
            return list(find_all(s, ''.join(words)))

        for word in words:
            length = len(word)
            result = list(find_all(s, word))
            regrex.append(result)
            regrex_list.extend(result)

        regrex_list = list(set(regrex_list))
        regrex_list.sort()

        result_list = []

        for i in range(len(regrex_list)-(num-1)):
            result = []
            for j in range(num):
                temp = regrex_list[i] + j*length
                if temp in regrex_list:
                    result.append(temp)
                else:
                    break
            if len(result) == num:
                result_list.append(result)

        import itertools
        result = []
        for i in itertools.product(*regrex):
            i = list(i)
            i.sort()
            if i in result_list:
                need_result = i[0]
                if need_result not in result:
                    result.append(need_result)

        return result


def find_all(a_str, sub):
    start = 0
    while True:
        start = a_str.find(sub, start)
        if start == -1: return
        yield start
        start += 1


